import React, { Component } from "react";
import NewsItem from "./NewsItem/NewsItem";


class LatestNews extends Component {
  state = {};

  render() {
    return (
      <>
      <h2>Latest news</h2>
        <NewsItem/>
        
      </>
    );
  }
}
export default LatestNews;
